import React, { Component } from 'react';
import { Container, Col, Row } from 'reactstrap';
import './App.css';
import Select from 'Select.js';
import Button from 'Button.js';

class ChooseLevel extends Component {
    render() {
        return (
            <Container id="choose-level">
                <h3>Select how many rows you want to play then press the button to start!</h3>
                <div id="levels" align="center">

                    <select name="rowNumber" form="rowNumber" id="row">
                        <option value="1">1</option>
                        <option value="2">2</option>
                        <option value="3">3</option>
                        <option value="4">4</option>
                        <option value="5">5</option>
                        <option value="6">6</option>
                        <option value="7">7</option>
                        <option value="8">8</option>
                        <option value="9">9</option>
                        <option value="10">10</option>
                        <option value="11">11</option>
                        <option value="12">12</option>
                    </select>
                    <label>Rows</label>
                    <button onclick="start()">
                        <h3>Start</h3>
                    </button>
                </div>
            </Container>

        );
    }
}

export default ChooseLevel;
